import Link from 'next/link';
import StyleBase from '../components/StyleBase';

const Media = () => {
    return (
        <StyleBase>
            <section>
                <h2>VIDEOS</h2>
                <div className="videoContainer">
                    <div className="loading">Loading</div>
                    <iframe src="https://www.youtube.com/embed/Ofv5mz3Jvak" frameBorder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>

                    <style jsx>{`
                    iframe {
                    width: calc(100vw - 2rem);
                    height: calc(56.25vw - 2rem);
                    border: 2px solid #f29a2f;
                    display: flex;
                    justify-content: center;
                    z-index: 2;
                    }
                    .videoContainer {
                        display: flex;
                        flex-direction: column;
                        justify-content: center;
                        align-items: center;
                    }
                    .loading {
                        display: flex;
                        justify-content: center;
                        align-items: center;
                        width: calc(100vw - 2rem);
                        height: calc(56.25vw - 2rem);
                        position: absolute;
                        background: #f29a2f;
                        color: #222;
                        z-index: 1;
                    }
                    `}</style>
                </div>
            </section>
        </StyleBase>
    )
}

export default Media;
